import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 6.2-840 Filing requirements.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-840.md","filePath":"vacode/6.2-840.md"}'),r={name:"vacode/6.2-840.md"},o=i('<h1 id="§-6-2-840-filing-requirements" tabindex="-1">§ 6.2-840 Filing requirements. <a class="header-anchor" href="#§-6-2-840-filing-requirements" aria-label="Permalink to &quot;§ 6.2-840 Filing requirements.&quot;">​</a></h1><p>An out-of-state bank desiring to establish and maintain a de novo branch or to acquire a branch in the Commonwealth shall submit to the Commission a copy of the application it files with its home state supervisor or the responsible federal banking agency to establish or acquire such branch. Such submission shall be made at the same time the application is filed by the out-of-state bank with such home state supervisor or responsible federal banking agency. The out-of-state bank shall also comply with the requirements of Article 17 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-757/" target="_blank" rel="noreferrer">13.1-757</a> et seq.) of the Virginia Stock Corporation Act and pay any filing fee required by the Commission.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0301" target="_blank" rel="noreferrer">301</a>, § 6.1-44.6; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',3),n=[o];function s(l,c,h,p,_,f){return t(),a("div",null,n)}const u=e(r,[["render",s]]);export{d as __pageData,u as default};
